import React from 'react';

const PlayerCard = ({ playerName, playerPosition, playerTeam, playerScore, playerImage }) => (
  <div className="player-card">
    <div className="player-image-container">
      <img src={playerImage} alt={`${playerName}`} className="player-image" />
    </div>
    <div className="player-info">
      <div className="player-name">{playerName}</div>
      <div className="player-position">{playerPosition}</div>
      <div className="player-team">{playerTeam}</div>
    </div>
    <div className="player-score">{playerScore}</div>
  </div>
);

export default PlayerCard;
